class PackedScene(py4godot_resource.Resource):
  r'''
		A simplified interface to a scene file. Provides access to operations and checks that can be performed on the scene resource itself.
		Can be used to save a node to a file. When saving, the node as well as all the nodes it owns get saved (see `Node.owner` property).
		**Note:** The node doesn't need to own itself.
		**Example:** Load a saved scene:
		
		```gdscript
		# Use load() instead of preload() if the path isn't known at compile-time.
		var scene = preload("res://scene.tscn").instantiate()
		# Add the node as a child of the node the script is attached to.
		add_child(scene)
		```
		
		
		**Example:** Save a node with different owners. The following example creates 3 objects: `Node2D` (`node`), `RigidBody2D` (`body`) and `CollisionObject2D` (`collision`). `collision` is a child of `body` which is a child of `node`. Only `body` is owned by `node` and `pack` will therefore only save those two nodes, but not `collision`.
		
		```gdscript
		# Create the objects.
		var node = Node2D.new()
		var body = RigidBody2D.new()
		var collision = CollisionShape2D.new()

		# Create the object hierarchy.
		body.add_child(collision)
		node.add_child(body)

		# Change owner of `body`, but not of `collision`.
		body.owner = node
		var scene = PackedScene.new()

		# Only `node` and `body` are now packed.
		var result = scene.pack(node)
		if result == OK:
			var error = ResourceSaver.save(scene, "res://path/name.tscn")  # Or "user://..."
			if error != OK:
				push_error("An error occurred while saving the scene to disk.")
		```
		
		
	'''

  @staticmethod
  def constructor():
    class_ = PackedScene.construct_without_init()
    class_._ptr = constructor(567,0, ())
    return class_
  @staticmethod
  def new():
    class_ = PackedScene.construct_without_init()
    class_._ptr = constructor(567,0, ())
    return class_
  def __init__(self):
    self._ptr =  CPPPackedSceneWrapper()
    if c_utils.shouldCreateObject:
      self._ptr = constructor(567,0, ())


  def generate_wrapper(self):
    return CPPPackedSceneWrapper()
  def init_signals(self):
    super().init_signals()

  @staticmethod
  def construct_without_init():
    cls = PackedScene.__new__(PackedScene)
    cls.shouldBeDeleted = True
    cls.init_signals()
    return cls
  @staticmethod
  def get_type():
    return 'PackedScene'

  def __del__(self):
    pass
  @staticmethod
  def cast(other:'Object'):
    assert other != None # Object to be casted must not be None
    cls = PackedScene.construct_without_init()
    cls._ptr = CPPPackedSceneWrapper()
    cls._ptr_before = other._ptr # Save pointer
    cls._ptr.copy_gdowner(cls._ptr_before)
    cls.casted_from = other
    return cls
  @staticmethod
  def cast_without_reference(other: 'Object'):
    assert other != None # Object to be casted must not be None
    cls = PackedScene.construct_without_init()
    cls._ptr = CPPPackedSceneWrapper()
    cls._ptr_before = other._ptr # Save pointer
    cls._ptr.copy_gdowner(cls._ptr_before)
